import React from 'react'
import Navbar from '../Navbar'
import Footer from '../Footer'
import { Link } from 'react-router-dom'

const ProgressBar = () => {
  const [apiData, setApiData] = useState({ status: '' });

  useEffect(() => {
    // Replace 'your-api-url-here' with the actual URL of your API endpoint
    fetch('http://172.22.81.182:8080/rfid/getstat/12')
      .then((response) => response.text())
      .then((data) => {
        // Assuming the API response contains only the plain text "REACHED"
        setApiData({ status: data.trim() });
      })
      .catch((error) => {
        console.error('Error fetching data from API:', error);
      });
  }, []);

  const labels = ['DISPATCHED', 'REACHED', 'REACHED HUB 1', 'REACHED HUB 2', 'OUTFORDEL'];
}

export default function Shipping() {
  return (
    <div>
      <Navbar/>
        <div className="min-h-screen flex flex-col ml-5">
        <ul className="steps steps-vertical">
          <li className="step step-primary">Dispatched</li>
          <li className="step step-primary">Reached Hub1</li>
          <li className="step">Reached Hub2</li>
          <li className="step">Out for delivery</li>
        </ul>
      </div>
      <div>
        <Link to='/map'>
            <button className='bg-yellow-400'>
              Track
            </button>
        </Link>
      </div>
      <div className='items-baseline'>
        <Footer/>
      </div>
      
    </div>
  )
}
